p=A.b([A.eU(A.b(["C#\uc740 \uc81c\uac00 \uac1c\uc778\uc801\uc73c\ub85c \uac00\uc7a5 \uc88b\uc544\ud558\ub294 \uc5b8\uc5b4\uc785\ub2c8\ub2e4. Kotlin\uc744 \uc775\ud788\uba70 \uac00\uc0c1\uba38\uc2e0(VM)\uc5d0 \ub300\ud55c \ud765\ubbf8\uac00 \ucee4\uc84c\uace0, \ube44\uc2b7\ud55c \uad6c\uc870\ub97c \uac00\uc9c4 C#\uacfc .NET\uc5d0\ub3c4 \uc790\uc5f0\uc2a4\ub7fd\uac8c \uad00\uc2ec\uc744 \uac00\uc9c0\uac8c \ub418\uc5c8\uc2b5\ub2c8\ub2e4. C#\uc744 \ucc98\uc74c \uc0ac\uc6a9\ud560 \ub54c\uc5d0\ub294 Python\uacfc\uc758 \uc5f0\ub3d9\uc744 \ud1b5\ud574 \ud65c\uc6a9\ud588\uace0, .NET\uc774 Java\uc5d0 \ube44\ud574 \ub6f0\uc5b4\ub09c \uc131\ub2a5\uc744 \ubcf4\uc774\ub294 \uc810\ub3c4 \uc778\uc0c1\uc801\uc774\uc5c8\uc9c0\ub9cc, \ud2b9\ud788 .NET Native\uc640 \uc720\uc5f0\ud55c \ud50c\ub7ab\ud3fc \ub77c\uc774\ube0c\ub7ec\ub9ac \ubc14\uc778\ub529 \uac19\uc740 \ud655\uc7a5\uc131\uc5d0 \uc8fc\ubaa9\ud558\uac8c \ub418\uc5c8\uc2b5\ub2c8\ub2e4.",".NET\uc774 .NET Core\ub85c \uac1c\ud3b8\ub418\uba74\uc11c 1.0 \ubc84\uc804\ubd80\ud130 \uba40\ud2f0\ud50c\ub7ab\ud3fc\uc744 \uacf5\uc2dd \uc9c0\uc6d0\ud558\uac8c \ub418\uc5c8\ub294\ub370, \ub9c8\uc774\ud06c\ub85c\uc18c\ud504\ud2b8\uc758 \ud0c4\ud0c4\ud55c \uac1c\ubc1c\uc790 \ubb38\uc11c \ub355\ubd84\uc5d0 \uac1c\ubc1c \uacfc\uc815\uc5d0\uc11c \ud070 \ub3c4\uc6c0\uc744 \ubc1b\uc744 \uc218 \uc788\uc5c8\uc2b5\ub2c8\ub2e4. \ub355\ubd84\uc5d0 \ub2e4\uc591\ud55c \ud50c\ub7ab\ud3fc\uc744 \ub300\uc0c1\uc73c\ub85c \uc9c1\uc811 \ub9cc\ub4e0 \uc571\ub4e4\uc744 \uc2e4\ud589\ud560 \uc218 \uc788\uc5c8\uc8e0. \uc774\ud6c4 ASP.NET Core\ub97c \uc774\uc6a9\ud55c \uc6f9 \uac1c\ubc1c, GPGPU\ub97c \ud65c\uc6a9\ud55c \ubcd1\ub82c \ucef4\ud4e8\ud305, \uadf8\ub9ac\uace0 \uc571 \uac1c\ubc1c\uc5d0\ub294 MAUI\ub97c \ud65c\uc6a9\ud558\ub294 \ub4f1 \ub2e4\uc591\ud55c \ud504\ub85c\uc81d\ud2b8\uc5d0 C#\uacfc .NET\uc744 \uc0ac\uc6a9\ud574 \ubcf4\uc558\uc2b5\ub2c8\ub2e4."],p),null),A.eU(A.b(["\uc1fc\ud551\ubab0 Demo \ud504\ub85c\uc81d\ud2b8\ub97c \ub9cc\ub4e4 \ub54c Next.js\ub97c \uc0ac\uc6a9\ud588\uc2b5\ub2c8\ub2e4. Next.js\ub9cc\uc73c\ub85c \ubaa8\ub4e0 \ucc98\ub9ac\ub97c \ud560 \uc218 \uc788\uc9c0\ub9cc, \ub300\uaddc\ubaa8 \uc694\uccad\uc744 \uac00\uc815\ud55c\ub2e4\uba74 Next.js\uc640 \ubd84\ub9ac\ub41c \ubcc4\ub3c4\uc758 API \uc11c\ubc84\ub97c \uad6c\uc131\ud558\ub294 \uac83\uc774 \uc801\uc808\ud588\uc2b5\ub2c8\ub2e4.","\ubc31\uc5d4\ub4dc \uc11c\ubc84 \ud504\ub808\uc784\uc6cc\ud06c\ub4e4\uc740 \uac01 \uc5b8\uc5b4\ub4e4\uc5d0 \ud6cc\ub96d\ud55c \ud504\ub808\uc784\uc6cc\ud06c\ub4e4\uc774 \uc788\uace0, \uc774\ubbf8 \uc775\uc219\ud55c Java\uc640 Kotlin\uc758 Spring Boot\ub97c \uc0ac\uc6a9\ud560 \uc218\ub3c4 \uc788\uc5c8\uc9c0\ub9cc, \uc81c\uac00 ASP.NET Core\ub97c \uc120\ud0dd\ud55c \uc8fc\uc694 \uc774\uc720\uac00 \uc788\uc2b5\ub2c8\ub2e4.","\ub2f7\ub137\uc740 IL(\uc911\uac04 \uc5b8\uc5b4)\ub85c \ube4c\ub4dc\ub418\uace0, Java\uc640 \uac19\uc740 \ubc29\uc2dd\uc784\uc5d0\ub3c4 \ube4c\ub4dc \uc18d\ub3c4\uac00 \ub9e4\uc6b0 \ube60\ub974\ub2e4\ub294 \ud070 \uc7a5\uc810\uc774 \uc788\uc2b5\ub2c8\ub2e4. \ub355\ubd84\uc5d0 \ucf54\ub4dc \uc218\uc815 \ud6c4 \ube60\ub974\uac8c \uacb0\uacfc\ub97c \ud655\uc778\ud560 \uc218 \uc788\uc5c8\uace0, \ube4c\ub4dc \uacfc\uc815\uc774 \ube60\ub974\ub2e4\uace0 \ud574\uc11c \ucd5c\uc801\ud654\uac00 \ubd80\uc871\ud55c \uac83\ub3c4 \uc544\ub2c8\uc5c8\uc2b5\ub2c8\ub2e4. \ub2f7\ub137 \ub7f0\ud0c0\uc784\uc740 \uc2e4\ud589 \ud328\ud134\uc744 \ubd84\uc11d\ud558\uc5ec \uc131\ub2a5\uc744 \ucd5c\uc801\ud654\ud558\ub294 \ub2a5\ub825\uc774 \ub6f0\uc5b4\ub098\uba70, \ube4c\ub4dc \ud6c4 \uc0dd\uc131\ub41c \ubc88\ub4e4\uc758 \ud06c\uae30\ub3c4 \uacbd\ub7c9\uc774\uc5c8\uc2b5\ub2c8\ub2e4. \uc774\ub7ec\ud55c \uc694\uc18c\ub4e4\uc774 \uc800\uc5d0\uac8c ASP.NET\uc744 \uc120\ud0dd\ud558\uac8c \ub9cc\ub4e4\uc5c8\uc2b5\ub2c8\ub2e4."],p),"ASP.NET Core \ubc31\uc5d4\ub4dc \uac1c\ubc1c"),A.eU(A.b(["MAUI\ub294 \ub2f7\ub137\uc744 \ud1b5\ud55c \ud06c\ub85c\uc2a4 \ud50c\ub7ab\ud3fc \uc571 \uac1c\ubc1c\uc744 \uac00\ub2a5\ud558\uac8c \ud574\uc8fc\ub294 \ud504\ub808\uc784\uc6cc\ud06c\uc785\ub2c8\ub2e4. MAUI\ub97c \uc811\ud55c \uc2dc\uc810\uc5d0\ub294 \uc774\ubbf8 \ud50c\ub7ec\ud130\ub97c \ud1b5\ud574 \uc571 \uac1c\ubc1c\uc5d0 \uc775\uc219\ud55c \uc0c1\ud0dc\uc600\uc73c\uba70, \ub9ac\uc561\ud2b8 \ub124\uc774\ud2f0\ube0c \ub610\ud55c \uc0ac\uc6a9\ud574 \ubcf4\uc558\uc2b5\ub2c8\ub2e4. \ud558\uc9c0\ub9cc \uac1c\uc778\uc801\uc73c\ub85c MAUI\ub294 \uc7a0\uc7ac\ub825\uc774 \ud06c\ub2e4\uace0 \uc0dd\uac01\ud569\ub2c8\ub2e4. \uadf8 \uc774\uc720\ub294 MAUI\uac00 \ub2f7\ub137\uc73c\ub85c \uad6c\ud604\ub41c\ub2e4\ub294 \uc810\uc785\ub2c8\ub2e4. \ube44\uc2b7\ud55c \uad6c\uc870\ub97c \uac00\uc9c4 \ub9ac\uc561\ud2b8 \ub124\uc774\ud2f0\ube0c\ub294 JavaScript\ub97c \ubc14\uc774\ud2b8\ucf54\ub4dc\ub85c \ubbf8\ub9ac \ucef4\ud30c\uc77c\ud558\uace0 \uc2e4\ud589\ud560 \uc218 \uc788\uc9c0\ub9cc, \uae30\uacc4\uc5b4\ub85c \ubbf8\ub9ac \ucef4\ud30c\uc77c\ud560 \uc218\ub294 \uc5c6\uc2b5\ub2c8\ub2e4. \uadf8\ub7ec\ub098 MAUI\uc5d0\uc11c\ub294 \ub2f7\ub137\uc758 C# \uc790\uccb4\uac00 \uc815\uc801 \ud0c0\uc785 \uc5b8\uc5b4\uc774\uae30 \ub54c\ubb38\uc5d0 \uae30\uacc4\uc5b4\ub85c \ucef4\ud30c\uc77c\uc774 \uac00\ub2a5\ud558\uba70, \uc2e4\uc81c\ub85c \uc6b0\uc218\ud55c \uc131\ub2a5\uc744 \ubcf4\uc5ec\uc90d\ub2c8\ub2e4.","\ub610\ud55c, \uc774\ubbf8 \uac1c\ubc1c\ub41c \ud50c\ub7ab\ud3fc \uc804\uc6a9 \ub77c\uc774\ube0c\ub7ec\ub9ac\ub97c \ubc14\uc778\ub529\ud558\uc5ec \uc0ac\uc6a9\ud558\ub294 \ub370 \uc788\uc5b4\uc11c \uc790\uc720\ub3c4\uac00 \ub192\uace0 \uc131\ub2a5 \uba74\uc5d0\uc11c\ub3c4 \ub6f0\uc5b4\ub0a9\ub2c8\ub2e4. \ubc14\uc778\ub529 \uacfc\uc815 \uc790\uccb4\ub294 \ub2e4\ub978 \ud504\ub808\uc784\uc6cc\ud06c\uc5d0 \ube44\ud574 \uc5b4\ub835\uc9c0\ub9cc, MAUI \ub124\uc784\uc2a4\ud398\uc774\uc2a4\uc5d0\uc11c Android API\uc640 Java \uac1d\uccb4, iOS API\uc640 Objective-C \uac1d\uccb4\ub97c \uc0dd\uc131\ud558\uace0 \uc0ac\uc6a9\ud558\ub294 \uac83\uc744 \uc9c0\uc6d0\ud558\uc5ec \uc774\ub4e4\uc758 \ub77c\uc774\ube0c\ub7ec\ub9ac\ub97c \uac70\uc758 \uadf8\ub300\ub85c \uac00\uc838\uc640 \uc0ac\uc6a9\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4. \ubb3c\ub860 \uc774 \uc791\uc5c5\uc740 \ubcf5\uc7a1\ud558\uace0 \uc5b4\ub835\uc9c0\ub9cc, \uba40\ud2f0\ud50c\ub7ab\ud3fc\uc5d0\uc11c \ub124\uc774\ud2f0\ube0c \ub77c\uc774\ube0c\ub7ec\ub9ac\ub97c \uc6b0\uc218\ud55c \uc131\ub2a5\uc73c\ub85c \uc0ac\uc6a9\ud560 \uc218 \uc788\uac8c \ud574\uc90d\ub2c8\ub2e4. \ub2e4\ub978 \ud504\ub808\uc784\uc6cc\ud06c\uc5d0\uc11c\ub294 \ubcf4\ud1b5 \ubc14\uc778\ub529\uc744 \ud1b5\uc2e0 \ucc44\ub110\uc744 \ud1b5\ud574 \uad6c\ud604\ud558\uba70, \uc774\ub294 \ub300\ubd80\ubd84\uc758 \uc791\uc5c5\uc5d0\uc11c\ub294 \uad1c\ucc2e\uc740 \uc131\ub2a5\uc744 \ubcf4\uc774\uc9c0\ub9cc \ubcd1\ubaa9\uc774 \uc0dd\uae38 \uc218 \uc788\uc2b5\ub2c8\ub2e4. \uc800\ub294 MAUI\uc5d0\uc11c \uad6c\uae00 MLKit\uc758 TextRecognition\uc744 \ubc14\uc778\ub529\ud558\uc5ec \uad6c\ud604\ud574 \ubcf4\uc558\uc2b5\ub2c8\ub2e4."],p),"MAUI \ud65c\uc6a9\uae30")],t.Yg)
